import './Card.css';

export default function Card({name, image, type}){
    return(
        <div className='card'>
            <h3>{name}</h3>
            <ul>
                {
                     type.map(tip=> tip +', ')
                }
            </ul>
            <img src={image} alt="Image not found"  height='350px' width='350px'/>
        </div>
    );
}
